Vamos ver uma ave da ordem psittaciforme, da família Psittacidae.
Seu nome científico é Psittacus erithacus.
Apresenta vários nomes populares como arara-de-barriga-amarela, arara-azul-e-amarela, canindé, arara-amarela e ara-arauna, este último vindo do tupi (lingua indígena brasileira), sendo ara = nome que designa várias espécies de papagaio, e una = nome para preto, escuro, sendo sua designação final traduzida para papagaio escuro.
Essa variação na denominação é devida às cores encontradas na espécie. 
Além disso, elas são emblemáticas do cerrado brasileiro, podendo também ser encontradas na Bolívia, no Paraguai e em alguns países da América Central. 
As araras são monogâmicas, uma vez que um indivíduo ao se unir a um parceiro(a) forma um par que nunca mais se separa. Após a morte de algum dos dois, o outro pode até mesmo entrar em depressão e raramente escolhe outro parceiro.
Quando as araras nascem são muito pequenas e frágeis, sendo frequente a morte nos primeiros 45 dias por causa de baratas ou até formigas. Na natureza podem chegar até 60 anos, enquanto que no cativeiro até os 70 anos. Para quem cuida desses animais em cativeiro, essa tarefa não é difícil mas requer muito espaço e tempo para que fiquem confortáveis.
